<p><strong>破釜沉舟</strong></p>
<p>该成语指把饭锅打破，把渡船凿沉，比喻不留退路，做事果决。在句中一般作谓语、宾语、状语。</p>
<p>也写作“破釜沉船”、“沉舟破釜”。</p>
